type Experience = {
        title: string;
        dateRange: {
            from: string;
            to: string;
        };
        content: string;
}

export const PreviousExperience = (
    props: Experience
) => {
    return (
        <table>
            <tr>
                <td> <h3>{props.title}</h3> </td>
                <td> {props.dateRange.from} - {props.dateRange.to} </td>
            </tr>
            <tr>
                <td colSpan={2}> {props.content} </td>
            </tr>
        </table>
    );
};
